import { Nav, Navigate } from 'react-router-dom';

const Head = () => {
  return (

    <div className='text-3xl sticky top-0  bg-black z-10 text-red-500 font-bold p-3 border-b-2 border-gray-500 flex justify-between items-center'>

       <Nav to={"/"}><span>Fly<span className= "text-white">oont</span></span>  </Nav>

  <h1 className='text-lg text-white flex items-center cursor-pointer'>
       <Nav to={"/add"}  >Add movie</Nav>  
       </h1>
  <Nav to={"/j"} >h1</Nav>
  <Nav to={"/y"}> h2</Nav>
  <Nav to={"/h"}>h3</Nav>

    </div>

  )
}

export default Head
